import { borderRadius } from "@mui/system";
import React from "react";
import SkillBar from 'react-skillbars';

const styleCard = {
  height: "100%",
  paddingBottom: "50px",
  width: "60%",
  borderRadius: "20px",
  boxShadow: "0px 8px 16px 0px rgba(0,0,0,0.2)",

  display: "flex",
  flexDirection: "column",
  justifyContent: "center",
  alignItems: "center",
}

const styleSkillbar = {
  paddingTop: "50px",
  width:"70%",
}

const styleColors = {
  bar: "#3498db",
  title: {
    text: "#fff",
    background: "#2980b9"
  }
};

function SkillsetCard(props){

    const title = "Programming";
    const skills = [
      { type: 'Java', level: 85 },
      { type: 'Javascript', level: 75 },
    ];


  return (
    <div style={styleCard}>
        <h2 style={{paddingTop:"100px", alignItems:"center", textAlign:"center"}}>{title}</h2>
        <div style={styleSkillbar}>
         <SkillBar skills={skills} height={20} colors={styleColors}/>
        </div>
    </div>
  )
}

export default SkillsetCard;
